function App() {

  return (
    <div>
       <BrowserRouter>
      <Switch>
        <Route exact path="/" component={FirstPage} />
        <Route path="/secondpage" component={SecondPage} />
      </Switch>
    </BrowserRouter>
    </div>
  );
}

export default App;
